export const BASEURL = "http://localhost:5000/api";

export const API_URLs = {
  initialize: `${BASEURL}/initialize`,
  fetchTable: `${BASEURL}/transactions`,
  fetchStatistics: `${BASEURL}/statistics`,
  fetchBarChart: `${BASEURL}/bar-chart`,
  fetchPieChart: `${BASEURL}/pie-chart`,
  fetchAllData: `${BASEURL}/all-data`,
};
